/*Table structure for table `sys_admin` */

DROP TABLE IF EXISTS `sys_admin`;

CREATE TABLE `sys_admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `account` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `telephone` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL,
  `role_id` int(2) DEFAULT NULL,
  `password` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '密码',
  `status` int(1) DEFAULT '1',
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

