/*Table structure for table `sys_admin_role` */

DROP TABLE IF EXISTS `sys_admin_role`;

CREATE TABLE `sys_admin_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `role_id` int(10) DEFAULT NULL,
  `admin_id` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `sys_admin_role` */

/*Table structure for table `sys_dict` */

DROP TABLE IF EXISTS `sys_dict`;

CREATE TABLE `sys_dict` (
  `dict_code` varchar(100) CHARACTER SET utf8mb4 NOT NULL COMMENT '主键',
  `dict_name` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '字典名字',
  `order_no` int(11) DEFAULT NULL COMMENT '排序',
  `description` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '修改时间',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `modify_time` date DEFAULT NULL COMMENT '修改时间',
  `is_visible` int(11) DEFAULT '0' COMMENT '是否禁用，1是0否',
  PRIMARY KEY (`dict_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据字典表类型';

/*Data for the table `sys_dict` */

/*Table structure for table `sys_dict_data` */

DROP TABLE IF EXISTS `sys_dict_data`;

CREATE TABLE `sys_dict_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `dict_code` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '数据类别ID',
  `dictdata_value` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '创建时间',
  `dictdata_name` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '创建时间',
  `is_fixed` int(11) DEFAULT NULL COMMENT '是否可读',
  `order_no` int(11) DEFAULT NULL COMMENT '排序',
  `description` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '修改时间',
  `create_time` date DEFAULT NULL COMMENT '创建时间',
  `modify_time` date DEFAULT NULL COMMENT '修改时间',
  `is_visible` int(11) DEFAULT '0' COMMENT '是否禁用，1是0否',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='数据字典表';

/*Data for the table `sys_dict_data` */

/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `menu_name` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `pid` int(11) DEFAULT NULL,
  `menu_url` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  `menu_level` int(11) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `list_order` int(5) DEFAULT NULL,
  `ico_class` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL,
  PRIMARY KEY (`id`)
